The Department of Nike Archives in Beaverton, OR is a place to be inspired by the past and imagine the future.

It‚Äôs where the game-worn artifacts that @miahamm, @mrapinoe, @mariekatoto, @wang_shuang7, and @ahegerberg are kept‚Äîthe stuff these legends wore and used while making history. They are just a few of the athletes who elevated football to new heights and inspired girls across the globe to step onto the field, fight for equality, and change the game once again. 

Meet three of those up next talents, the most recent athletes whose own keepsakes have been added to DNA: 

@felicitasflores100 Youngest-ever Nike sponsored player 
@olivia_moultrie Youngest athlete to go pro and score in the NWSL 
@esmeebrugts Ranked among the world‚Äôs top players under 19

Head to the link in bio to learn more. #Nike50

Who's better to interview Sue and Dee than Sue and Dee? 

@nike and @togethxr sat the duo down to talk karaoke, tricks of the trade, and what they‚Äôll leave behind in the league. 

Hit the link in bio to watch @sbird10 and @dianataurasi answer some not so frequently asked questions.

‚ÄúI have more responsibility now to help other people through their own path. I want to make sure they realize that it is possible to get to the highest level, but once you get to the highest level that‚Äôs when the real responsibility starts.‚Äù

@asisat_oshoala is the most decorated female African footballer of all time and widely regarded as one of the best players in the world. But her remarkable individual journey is just part of the story. She is building a foundation to amplify overlooked talent in Nigeria, providing opportunity for young footballers in her home country to pursue and have access to the sport. She is Never Done carrying the torch.

Click the link in bio to learn more about what Asisat is working on.

‚ÄúI am at peace with myself knowing that I am more than an athlete.‚Äù 

@alexmorgan13 may be one of the world‚Äôs most gifted soccer players, but that‚Äôs not how she defines herself. As she prepares for her the inaugural season of San Diego Wave FC, the forward is also focusing on creating a home for her family. As a mom to 2-year-old Charlie, Alex knows that a home is more than a place to sleep‚Äîit is a center of gravity and love in her busy life.

Never done setting the foundation.
